mutation siteRemoveSecondaryAwsVSocket ( $socketId:ID! ) {
	site ( ) {
		removeSecondaryAwsVSocket ( socketId:$socketId  )  {
			secondaryAwsVSocketRemoveSecondaryAwsVSocketPayload: secondaryAwsVSocket {
				siteSecondaryAwsVSocket: site {
					id
					name
				}

				id
				ipAddress
				subnet
				routeTableId
			}
		}

	}	
}
